    // return res

    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': '3a1311b807mshed5e7a54134cbd7p13b75bjsn935d26879093',
            'X-RapidAPI-Host': 'imdb8.p.rapidapi.com'
        }
    };
    
    fetch('https://imdb8.p.rapidapi.com/title/get-details?tconst=tt0944947', options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));
}

